import { Route, Routes } from "react-router-dom";
import SecondPage from "./SecondPage";
import ProductPageCategory from "./Product page category/ProductPageCategory";
import { Categories, ProductsPage, } from '../../Data/data'
import { useState } from "react";


const Mmnnnn = () => {
    const [cat, setCat] = useState()
    const appearCat = (Cat) => {

        const NewArray = []
        for (let i in Cat) {
            for (let f in Cat[i]) {
                for (let g in Cat[i][f]) {
                    NewArray.push(Cat[i][f][g])
                    setCat(NewArray)
                }
            }
        }
    }




    // console.log(cat)


    return (
        <div>
            {/* <button onClick={() => appearCat(Categories.Fashion)}>aaa</button> */}
            {/* <BrowserRouter> */}
            <Routes>
                <Route path='groceries' element={<SecondPage ProductsPage={ProductsPage.Supermarket} Categoties={Categories.supermarket} />} />
                <Route path='fashion' element={<SecondPage ProductsPage={ProductsPage.Fashion} on={() => appearCat(Categories.Fashion)} Cat={cat} />} />
                <Route path='health-beauty' element={<SecondPage ProductsPage={ProductsPage.HealthBeauty} onClick={Categories.HealthBeauty} />} />
                <Route path='baby-products' element={<SecondPage ProductsPage={ProductsPage.BabyProducts} />} />
                <Route path='phones-tablets' element={<SecondPage ProductsPage={ProductsPage.PhoneTablets} />} />

                <Route path="groceries/food-storage" element={<ProductPageCategory />} />
                <Route path="groceries/disposable-plates-cutlery" element={<ProductPageCategory />} />
                <Route path="groceries/disposable-cups" element={<ProductPageCategory />} />
                <Route path="groceries/trash-compost-lawn-bags" element={<ProductPageCategory />} />
                <Route path="groceries/detergent" element={<ProductPageCategory />} />
                <Route path="groceries/fabric-softner" element={<ProductPageCategory />} />
                <Route path="groceries/stain-removal" element={<ProductPageCategory />} />
                <Route path="groceries/air-fresheners" element={<ProductPageCategory />} />
                <Route path="groceries/food-storage" element={<ProductPageCategory />} />
                <Route path="groceries/Kitchen Cleaners" element={<ProductPageCategory />} />
                <Route path="groceries/Bathroom Cleaners" element={<ProductPageCategory />} />

                <Route path="fashion/womens-bags" element={<ProductPageCategory />} />
                <Route path="fashion/dresses-jumpsuits" element={<ProductPageCategory />} />
                <Route path="fashion/hoodies-sweatshirts" element={<ProductPageCategory />} />
                <Route path="fashion/mens-casual-shirts" element={<ProductPageCategory />} />
                <Route path="fashion/t-shirts-and-polos" element={<ProductPageCategory />} />
                <Route path="fashion/men-suits" element={<ProductPageCategory />} />
                <Route path="fashion/baby-boys-fashion" element={<ProductPageCategory />} />
                <Route path="fashion/baby-girl-fashion" element={<ProductPageCategory />} />

                <Route path="HealthBeauty/oral-care" element={<ProductPageCategory />} />
                <Route path="HealthBeauty/feminine-hygiene" element={<ProductPageCategory />} />
                <Route path="HealthBeauty/shave-hair" element={<ProductPageCategory />} />
                <Route path="HealthBeauty/body-skin-care" element={<ProductPageCategory />} />
                <Route path="HealthBeauty/eyes-treament-products" element={<ProductPageCategory />} />
                <Route path="HealthBeauty/facial-care-cleansers" element={<ProductPageCategory />} />
                <Route path="HealthBeauty/styling-tools" element={<ProductPageCategory />} />
                <Route path="HealthBeauty/styling-products" element={<ProductPageCategory />} />
                <Route path="HealthBeauty/shampoo-conditioner" element={<ProductPageCategory />} />
                <Route path="HealthBeauty/wellness-relaxation" element={<ProductPageCategory />} />
                <Route path="HealthBeauty/medical-supplies-equipment" element={<ProductPageCategory />} />
            </Routes>
            {/* </BrowserRouter> */}
        </div>
    )
}
export default Mmnnnn;
